import React from 'react';
import {Nav} from 'react-bootstrap';

const HomeNav = () => {
    return (
        <Nav>
            <Nav.Item>
                <Nav.Button
                    onClick={() => {
                        console.log("clicked");
                    }}
                >Back to Timeline</Nav.Button>
            </Nav.Item>
        </Nav>
    )
};

export default HomeNav;
